import React from "react"


const DnsSearcher = () => {
    return(
        <>
       <InputGroup className="mb-3">
        <InputGroup.Text id="basic-addon1">http://</InputGroup.Text>
        <Form.Control
          placeholder="url"
          aria-label="url"
          aria-describedby="basic-addon1"
        />
      </InputGroup>
      </>
    )
}

export default DnsSearcher;
